const mongoose = require("mongoose")
const Schema = mongoose.Schema

const staticImgSchema = new Schema({
  topImg: {
    type: String,
    default:
      "data:image/jpeg;base64,",
  },
  firstImg: {
    type: String,
    default:
      "data:image/png;base64,",
  },
  secondImg: {
    type: String,
    default:
      "data:image/png;base64,",
  },
  thirdImg: {
    type: String,
    default:
      "data:image/png;base64,",
  },
  lawyerImg: {
    type: String,
    default:
      "data:image/jpeg;base64,",
  },
})

// create mongoose Model
const StaticImg = mongoose.model("StaticImg", staticImgSchema)

// export the model so other modules can import it
module.exports = {
  StaticImg,
}